import React from "react";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import PropTypes from "prop-types";

import Header from "../../components/header/header.jsx";
import Footer from "../../components/footer/footer.jsx";
import img1 from '../../assets/images/img1.jpg';
import img2 from '../../assets/images/img2.jpg';
import img3 from '../../assets/images/img3.jpg';

const Home = () => {
    return (
        <div id="main-wrapper">
            <Header />
            <div className="page-wrapper">
                <div className="container-fluid">
                    <h1 className="title">Welcome to the Robotics Learning Hub!</h1>

                    <div className="intro-content">
                        <p>
                            Embark on a fascinating journey into the world of robotics with our comprehensive learning resources.
                            Whether you're a beginner or an enthusiast, our curated lessons and projects will guide you through the exciting realm of robotics programming.
                        </p>

                        <h2>Roadmap to Learning Robotics</h2>
                        <ol>
                            <li>
                                <h3>Introduction to Robotics</h3>
                                <p>Explore the basics of robotics, understanding its applications and significance in various industries.</p>
                                <img src={img1} alt="Introduction to Robotics" />
                            </li>
                            <li>
                                <h3>Programming with ROS</h3>
                                <p>Master the Robot Operating System (ROS) to program and control robots. Dive into hands-on lessons and practical examples.</p>
                                <img src={img2} alt="Programming with ROS" />
                            </li>
                            <li>
                                <h3>Advanced Robotics Concepts</h3>
                                <p>Delve into advanced topics such as robot localization, mapping, and control algorithms to elevate your robotics skills.</p>
                                <img src={img3} alt="Advanced Robotics Concepts" />
                            </li>
                        </ol>
                    </div>
                </div>
            </div>
            <Footer />
        </div>
    );
}

Home.propTypes = {
    classes: PropTypes.object
};

export default Home;
